import React from "react"


class User extends React.Component {

    render(){
      return (
        <div className="user" >
              <h3>
                {this.props.user.firstname} {this.props.user.lastname}
              </h3>
              <p>{this.props.user.bio}</p>
              <b>{this.props.user.isHappy ? "HAPPY" : "BAD"}</b>
            </div>
      )
  }


  }

  export default User
